import React from 'react';
import { Link } from "react-router-dom";
import './admin.css'; // Import the CSS file for the Admin component
import img from './';


const Admin = () => {
  return (
    <>

      <div className="home-content">
        <div className="right-admin-bg">
         <img className="position-absolute w-100 h-100 rounded" 
             src={require('../../Assets/img-6.jpg')} 
             alt="Background" 
             style={{ objectFit: 'cover' }} />

        </div>
        <div className="text-content">
          <h1>Best Healthcare Solution</h1>
          <h1>In Your City</h1>
          <div className="button-container">
            <Link to="/Getusers" className="button-primary">Get Users</Link>
            <Link to="/Getusers" className="button-secondary">Users</Link>
          </div>
        </div>
      </div>
    </>
  );
}

export default Admin;
